import React from "react";

const Provjere = () => {
  return (
    <div>
      Provjere
      <ul id="predmeti">
        {kategorije.map((kategorija) => (
          <Link to="">
            <li className="predmet">{kategorija.naziv}</li>
          </Link>
        ))}
      </ul>
    </div>
  );
};

export default Provjere;
